export default function Pokemon({ name, img, types }) {
  console.log("ENTRE A POKEMON");

  return (
    <div>
      <div className="card">
        <h1>{name}</h1>
        <img src={img} alt="" />
        {types.map((type) => (
          <h2>type</h2>
        ))}
      </div>
    </div>
  );
}
